parameters:    aliznet_wcs.reader.orm.category.class:          Aliznet\WCSBundle\Reader\ORM\CategoryReader    aliznet_wcs.reader.orm.attribute.class:         Aliznet\WCSBundle\Reader\ORM\AttributeReader    aliznet_wcs.reader.orm.attribute_values.class:  Aliznet\WCSBundle\Reader\ORM\AttributeValuesReader    aliznet_wcs.reader.doctrine.product.class :     Aliznet\WCSBundle\Reader\Doctrine\ProductReaderservices:    # Readers    aliznet_wcs.reader.orm.attribute:        class: %aliznet_wcs.reader.orm.attribute.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - %pim_catalog.entity.attribute.class%    aliznet_wcs.reader.orm.attribute_values:        class: %aliznet_wcs.reader.orm.attribute_values.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - %pim_catalog.entity.attribute_option.class%    aliznet_wcs.reader.doctrine.product:        class: %aliznet_wcs.reader.doctrine.product.class%        arguments:            - '@pim_catalog.repository.product'            - '@pim_catalog.manager.channel'            - '@pim_catalog.manager.completeness'            - '@pim_transform.converter.metric'            - '@pim_catalog.object_manager.product'    aliznet_wcs.reader.orm.category:        class: %aliznet_wcs.reader.orm.category.class%        arguments:            - '@pim_catalog.repository.category'              